  return (
    <div className='Content'>
      <div>{titleClickContent[0].title}</div>
      <div>{titleClickContent[0].username}{titleClickContent[0].createAt}</div>
      <div>내용</div>
      <div></div>
    </div>
  )
}

export default Read
